  false,\n\t\"url\": null,\n\t\"notes\": \"The Legislature is providing information
  free of charge to all interested parties through the use of Web Services. Web Services
  provide a mechanism allowing agencies, interest groups, and the general public to
  obtain real-time legislative information for their in-house applications, regardless
  of the development language and operating platform. Web Services are based on widely
  accepted standards which foster integration and communication between systems. nThe
  Legislature is providing the following information: Amendments, Committees, Committee
  Actions, Committee Meetings, Documents, Legislation, Statute Affected, Session Law,
